One way of verifying routes is via manual POST requests: Start the bot Generate a Slack signature for the request body being investigated, in this case command=/devopsbot, for example via go: package main import ( "crypto/hmac" "crypto/sha256" "encoding/hex" "fmt"
) func main() { h := hmac.New(sha256.New, []byte("<signing secret, empty if not specified>")) _, _ = h.Write([]byte("v0:<UNIX time stamp>:command=%2Fdevopsbot")) computed := h.Sum(nil) fmt.Println(hex.EncodeToString(computed))
} Post the request: curl -X POST -H 'Content-type: application/x-www-form-urlencoded' -H 'X-Slack-Request-Timestamp: <UNIX time stamp>' -H 'X-Slack-Signature: v0=<signature from previous step>' --data 'command=%2Fdevopsbot' localhost:3333/bot/command
